import React from 'react';


function MealsItem(props) {
	const price = `$${props.price.toFixed(2)}`;
  return (
	  <li>
		  <div><h2>{props.name}</h2></div>
		  <div>{props.description}</div>
		  <div>{price}</div>
	  </li>
  );
}

export default MealsItem;
